import React from 'react';
import Card from './Card';

function App() {
  const customers = [
    { name: 'John Doe', age: 30, phone: '555-123-4567' },
    { name: 'Jane Smith', age: 25, phone: '555-987-6543' },
    { name: 'Bob Johnson', age: 40, phone: '555-789-0123' },
    { department: 'Management', age: 45, phone: '010-5555-1111' },
    { name: 'Sara Ibrahim', age: 35, phone: '012-4444-2222' },
    { name: 'Zeinab Adel', age: 28, phone: '011-7777-3333' }
  ];

  return (
    <div>
      <h1>Customer Dashboard</h1>
      <Card customers={customers} />
    </div>
  );
}

export default App;
